import { CheckoutWrapper } from "../Styles/Modal-Style";


function CheckoutModal() {
    return(
        <>
            <CheckoutWrapper>
                <div className="checkout_inner">
                    <div className="head_sec">
                    <h5>MY CHECKOUT</h5>
                    <a><i className="fa-solid fa-arrow-right-long"></i></a>
                    </div>
                </div>
            </CheckoutWrapper>
        </>
    );
}

export default CheckoutModal;
